const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "face-mask"
    }}>{`Face Mask`}</h1>
    <p>{`In this project, the aim of is develop a `}<em parentName="p">{`demo`}</em>{` of scientific  and intelligent tools that can be used in the public health sector.`}</p>
    <h3 {...{
      "id": "introduction"
    }}>{`Introduction`}</h3>
    <p>{`In this project we made use of deep learning and SVMss to identify and classify  images of people wearing mask.
A Deep Learning driven method is used to identify whether the person is wearing mask or not. And a lightweight SVM is used for facial recognition.`}</p>
    <h4 {...{
      "id": "data"
    }}>{`Data`}</h4>
    <p>{`For the Maask wearing identification part of this project, there are a total of 3835 images belonging to two classes:
`}<strong parentName="p"><em parentName="strong">{`with_mask: 1916 images`}</em></strong>{`
`}<strong parentName="p"><em parentName="strong">{`without_mask: 1919 images`}</em></strong></p>
    <p>{`For the facial recognition part, you will need at least 10~15 images per person of interest in your dataset.`}</p>
    <h3 {...{
      "id": "models"
    }}>{`Models`}</h3>
    <p>{`In this project, the `}<a parentName="p" {...{
        "href": "https://keras.io/"
      }}>{`Keras`}</a>{` library was used along with `}<a parentName="p" {...{
        "href": "https://opencv.org/f"
      }}>{`OpenCV`}</a>{` to train the neural Network and the Support Vector Machine. The `}<a parentName="p" {...{
        "href": "https://arxiv.org/abs/1704.04861"
      }}>{`MobileNet`}</a>{` neural network was used for the Mask identification and it achieved an accuracy of `}<strong parentName="p"><em parentName="strong">{`93%`}</em></strong>{` on the task at hand.`}</p>
    <h3 {...{
      "id": "demo-code"
    }}>{`Demo Code`}</h3>
    <p>{`The demo for this project can be done on live Video. The instruction on how to run the code will be under the instructions markedown file.`}</p>
    <h3 {...{
      "id": "dateset-and-analysis"
    }}>{`Dateset and analysis`}</h3>
    <p>{`For each fish species, the data was randomly shuffled and a train and validation split was performed.
The dataset consists of very noisy and unclear pictures along with very well captured images.
The used dataset and was verified by experts in the aquatic domain ad therefore there are some pictures in the training set which belong to the wrong species of the fish.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
